var shouldStart = false;
var yaw;

function newLevel() {
	isInWorld = true;
	shouldStart = true;
	yaw = getYaw();
	if(musicPlayer.isPlaying()) musicPlayer.pause();
	musicPlayer.reset();
	if(ambiancePlayer.isPlaying()) ambiancePlayer.pause();
	ambiancePlayer.reset();
}

function leaveGame() {
	log.log("Left world '" + Level.getWorldName() + "' (" + Level.getWorldDir() + ")");
	isInWorld = false;
	runOnBackground(new Runnable({
		run: function() {
			ctx.runOnUiThread(new Runnable({
				run: function() {
					if(screen.window != null) {
						screen.window.dismiss();
						screen.window = null;
					}
				}
			}));
		}
	}));
	if(musicPlayer.isPlaying()) musicPlayer.pause();
	musicPlayer.reset();
	if(ambiancePlayer.isPlaying()) ambiancePlayer.pause();
	ambiancePlayer.reset();
}

function modTick() {
	var nYaw = getYaw();
	if(shouldStart === true) {
		if(Math.floor(nYaw) != Math.floor(yaw)) {
			shouldStart = false;
			log.log("Entered world '" + Level.getWorldName() + "' (" + Level.getWorldDir() + ")");
			runOnBackground(new Runnable({
				run: function() {
					checkForGamefiles();
					createBitmaps();
					showWindows();
				}
			}));
		}
		return;
	} if(Math.floor(Math.random() * 1000) == 0) {
		if(!musicPlayer.isPlaying()) {
			musicPlayer.reset();
			var rSound;
			var rS = (Level.getGameMode() == 0) ? Math.ceil(Math.random() * 4) : Math.ceil(Math.random() * 5);
			if(rS == 1) rSound = "calm" + Math.ceil(Math.random() * 3);
			if(rS == 2) rSound = "hal" + Math.ceil(Math.random() * 4);
			if(rS == 3) rSound = "nuance" + Math.ceil(Math.random() * 2);
			if(rS == 4) rSound = "piano" + Math.ceil(Math.random() * 3);
			if(rS == 5) rSound = "creative/creative" + Math.ceil(Math.random() * 6);
			playCustomSound(musicPlayer, "music/game/" + rSound + ".ogg");
		}
	} if(Math.floor(Math.random() * 5000) == 0) {
		if(!ambiancePlayer.isPlaying()) {
			ambiancePlayer.reset();
			var rX = getPlayerX() + Math.floor(Math.random() * 15) - 7;
			var rY = getPlayerY() + Math.floor(Math.random() * 15) - 7;
			var rZ = getPlayerZ() + Math.floor(Math.random() * 15) - 7;
			if(getTile(rX, rY, rZ) == 0 && Level.getBrightness(rX, rY, rZ) <= 4) {
				playCustomSound(ambiancePlayer, "ambient/cave/cave" + Math.ceil(Math.random() * 13) + ".ogg");
			}
		}
	}
}

function procCmd(cmd) {
	cmd = cmd.split(" ");
	if(cmd[0] == "dev") {
		if(cmd[1] == "enbldebug") {
			debug = true;
			log.log("Enabled debugging mode");
		} if(cmd[1] == "dsbldebug") {
			log.log("Disabled debugging mode");
			debg = false;
		}
	}
}

